import * as React from "react";

import "./custom-dots.styles.css";

const CustomDot = ({ onClick, active }) => {
  return (
    <li
      className="carousel__list"
      style={{ background: active ? "grey" : "initial" }}
    >
      <button
        className="carousel__button"
        style={{ background: active ? "grey" : "initial" }}
        onClick={() => onClick()}
      />
    </li>
  );
};

export default CustomDot;
